Creates an empty database with an optional schema.

             Usage:

             ```
             (empty-db) ; => #datascript/DB {:schema {}, :datoms []}

             (empty-db {:likes {:db/cardinality :db.cardinality/many}})
             ; => #datascript/DB {:schema {:likes {:db/cardinality :db.cardinality/many}}
             ;                    :datoms []}
             ```

